import React from "react";
import "../imagesContainer/imagesContainer.css";

import Image from './Image';

import bulma from './../../assets/images/bulma.png';
import chichi from './../../assets/images/chichi.png';
import frieza from './../../assets/images/frieza.png';
import gogeta from './../../assets/images/gogeta.png';
import grandkai from './../../assets/images/grandkai.png';
import kingkai from './../../assets/images/kingkai.png';
import mrsatan from './../../assets/images/mrsatan.png';
import shenron from './../../assets/images/shenron.png';
import southkai from './../../assets/images/southkai.png';


const imagesContainer = (props) => {

    const images = [{
        "id": 1,
        "image": bulma,
        "name": "Bulma"
    },
    {
        "id": 2,
        "image": chichi,
        "name": "Chi-Chi"
    },
    {
        "id": 3,
        "image": frieza,
        "name": "Frieza"
    },
    {
        "id": 4,
        "image": gogeta,
        "name": "Gogeta"
    },
    {
        "id": 5,
        "image": grandkai,
        "name": "Grand Kai"
    },
    {
        "id": 6,
        "image": kingkai,
        "name": "King Kai"
    },
    {
        "id": 7,
        "image": mrsatan,
        "name": "Mr. Satan"
    },
    {
        "id": 8,
        "image": shenron,
        "name": "Shenron"
    },
    {
        "id": 9,
        "image": southkai,
        "name": " South Kai"
    }
];

    shuffle = (images) => {
        var currentIndex = array.length, temporaryValue, randomIndex;

        // While there remain elements to shuffle...
        while (0 !== currentIndex) {

        // Pick a remaining element...
        randomIndex = Math.floor(Math.random() * currentIndex);
        currentIndex -= 1;

        // And swap it with the current element.
        temporaryValue = array[currentIndex];
        array[currentIndex] = array[randomIndex];
        array[randomIndex] = temporaryValue;
        }

        return array;
    }

    return(
        <div>
            <p>I am imagesContainer.</p>
            {images.map((image, i) => {
                return <Image key ={image.id} img = {image.image} imageAlt = {image.name} hideParentsParentP = {props.hideParentP}/>
            })}

        </div>
    )
}

export default imagesContainer;
